using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class ShellOutputModel : Notifier	{		public ShellOutputModel()		{					CourseNo = "";			MinThk = "";			StartPoint = "";			Width = "";			Length = "";			RepeatNo = "";		}				private string _CourseNo;		public string CourseNo			{				get { return _CourseNo; }				set				{					_CourseNo = value;					OnPropertyChanged(nameof(CourseNo));				}			}				private string _MinThk;		public string MinThk			{				get { return _MinThk; }				set				{					_MinThk = value;					OnPropertyChanged(nameof(MinThk));				}			}				private string _StartPoint;		public string StartPoint			{				get { return _StartPoint; }				set				{					_StartPoint = value;					OnPropertyChanged(nameof(StartPoint));				}			}				private string _Width;		public string Width			{				get { return _Width; }				set				{					_Width = value;					OnPropertyChanged(nameof(Width));				}			}				private string _Length;		public string Length			{				get { return _Length; }				set				{					_Length = value;					OnPropertyChanged(nameof(Length));				}			}				private string _RepeatNo;		public string RepeatNo			{				get { return _RepeatNo; }				set				{					_RepeatNo = value;					OnPropertyChanged(nameof(RepeatNo));				}			}			}}